import Button from './button';

function Fields(props) {
	console.log(props.data[0].title)
  return (
		<>
		{props.data[0].data}
			{
				props.data.map(i => {
					return (
							<div>
								<div>
									<h1 key={i}>{i.title}</h1>
									<p key={i+0}>{i.text}</p>
								</div>
								<div>
									<p>{i.number}</p>
								</div>
							</div>
					)
				})
			}
		</>
	)
};

export default Fields;
